  //Loading Screen

  return (
    <div className="game-page">
      <Loading />
    </div>
  );

  //Game Card
  return (
    <div className="game-page">
      <div className="game-content">
        <div className="game-question"></div>
        <div className="game-answers">
          return (<button className="answer-button"></button>
          );
        </div>
      </div>
    </div>
  );
};

export default GamePage;
